from collections import namedtuple
import testcase

case = namedtuple("Testcase", ["Input", "Output"])


class Testcase(testcase.Testcase):
    def __init__(self):
        self.testcases = []
        self.testcases.append(case(Input="babad", Output="bab"))
        self.testcases.append(case(Input="cbbd", Output="bb"))
        self.testcases.append(case(Input="a", Output="a"))
        self.testcases.append(case(Input="ac", Output="a"))
        self.testcases.append(case(Input="ccc", Output="ccc"))
        self.testcases.append(case(Input="abbcccbbbcaaccbababcbcabca", Output="bbcccbb"))
        self.testcases.append(case(Input="bananas", Output="anana"))
        self.testcases.append(case(Input="baaaab", Output="baaaab"))
        self.testcases.append(case(Input="", Output=""))

    def get_testcases(self):
        return self.testcases
